import { Injectable } from "@angular/core";
import { INumberIsEven } from "../Services.Abstractions/INumberIsEven";


@Injectable()
export class NumberIsEven implements INumberIsEven {
    public isEqual(number: number): boolean {
        return number % 2 == 0;
    }
}
